// GetProgramsData returns the loaded programs data.
func GetProgramsData() *ProgramsChummer {
	return programsData
}

// GetAllPrograms returns all programs.
func GetAllPrograms() []ProgramItem {
	if len(programsData.Programs) == 0 {
		return []ProgramItem{}
	}
	return programsData.Programs[0].Program
}

// GetProgramByID returns the program with the given ID, or nil if not found.
func GetProgramByID(id string) *ProgramItem {
	programs := GetAllPrograms()
	for i := range programs {
		if programs[i].ID == id {
			return &programs[i]
		}
	}
	return nil
}
